import React, { Component } from 'react';

import LandingPage from './components/LandingPage';
import GameSession from './components/GameSession';

class App extends Component {
  render() {
    return (
      <div>
        <TopMenu />
        <LandingPage />
        <GameSession />
        <Footer />
      </div>
    );
  }
}

export default App;
